import { createUseStyles } from 'react-jss';
var usePaddingStyles = createUseStyles({
    'small-none': {
        padding: '10px 0',
    },
    xxsmall: {
        padding: 2.5,
    },
    xsmall: {
        padding: 5,
    },
    small: {
        padding: 10,
    },
    medium: {
        padding: 15,
    },
    large: {
        padding: 20,
    },
    xlarge: {
        padding: 25,
    },
    xxlarge: {
        padding: 30,
    }
});
var usePaddingHorizontalStyles = createUseStyles({
    xxsmall: {
        paddingLeft: 2.5,
        paddingRight: 2.5,
    },
    xsmall: {
        paddingLeft: 5,
        paddingRight: 5,
    },
    small: {
        paddingLeft: 10,
        paddingRight: 10,
    },
    medium: {
        paddingLeft: 15,
        paddingRight: 15,
    },
    large: {
        paddingLeft: 20,
        paddingRight: 20,
    },
    xlarge: {
        paddingLeft: 25,
        paddingRight: 25,
    },
    xxlarge: {
        paddingLeft: 30,
        paddingRight: 30,
    }
});
export { usePaddingStyles, usePaddingHorizontalStyles, };
